import React, { useState } from 'react';
import DatePicker from 'react-datepicker';
import './CreateProject.css';
import 'react-datepicker/dist/react-datepicker.css';
import 'bootstrap/dist/css/bootstrap.min.css';

const CreateProject = () => {
  const [formData, setFormData] = useState({
    title: '',
    eik: '',
    parcelArea: '',
    startDate: new Date(),
    endDate: new Date(),
    apartments: '',
    buildingStatus: '', // Ново поле за статус на сграда
  });

  const [errors, setErrors] = useState({});

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleDateChange = (date, name) => {
    setFormData({
      ...formData,
      [name]: date
    });
  };

  const createBuilding = (e) => {
    e.preventDefault();
    // Валидация на полетата
    const newErrors = {};
    if (!formData.title) newErrors.title = 'Title is required';
    if (!formData.eik) newErrors.eik = 'Eik is required';
    if (!formData.parcelArea) newErrors.parcelArea = 'Parcel area is required';
    if (!formData.startDate) newErrors.startDate = 'Start Date is required';
    if (!formData.endDate) newErrors.endDate = 'End Date is required';
    if (!formData.apartments) newErrors.apartments = 'Number of apartments is required';
    if (!formData.buildingStatus) newErrors.buildingStatus = 'Building Status is required';

    if (Object.keys(newErrors).length > 0) {
      setErrors(newErrors);
    } else {
      // Логика за създаване на проекта
      console.log('Building Created:', formData);
      alert('Building created successfully!');
    }
  };

  return (
    <div className="container-center">
      <div className="card">
        <div className="card-body">
          <h1>Start New Project</h1>
          <form onSubmit={createBuilding}>
            <div className="form-group">
              <label htmlFor="title">Title</label>
              <input
                type="text"
                className={`form-control ${errors.title ? 'is-invalid' : ''}`}
                id="title"
                name="title"
                placeholder="Title"
                value={formData.title}
                onChange={handleInputChange}
                required
              />
              {errors.title && <small className="text-danger">{errors.title}</small>}
            </div>

            <div className="form-group">
              <label htmlFor="eik">Eik</label>
              <input
                type="text"
                className={`form-control ${errors.eik ? 'is-invalid' : ''}`}
                id="eik"
                name="eik"
                placeholder="Eik"
                value={formData.eik}
                onChange={handleInputChange}
                required
              />
              {errors.eik && <small className="text-danger">{errors.eik}</small>}
            </div>

            <div className="form-group">
              <label htmlFor="parcelArea">Adress</label>
              <input
                type="text"
                className={`form-control ${errors.parcelArea ? 'is-invalid' : ''}`}
                id="parcelArea"
                name="parcelArea"
                placeholder="Add²"
                value={formData.parcelArea}
                onChange={handleInputChange}
                required
              />
              {errors.parcelArea && <small className="text-danger">{errors.parcelArea}</small>}
            </div>


            <div className="form-group">
              <label htmlFor="parcelArea">Parcel Area</label>
              <input
                type="text"
                className={`form-control ${errors.parcelArea ? 'is-invalid' : ''}`}
                id="parcelArea"
                name="parcelArea"
                placeholder="in m²"
                value={formData.parcelArea}
                onChange={handleInputChange}
                required
              />
              {errors.parcelArea && <small className="text-danger">{errors.parcelArea}</small>}
            </div>

            <div className="date-group">
              <div className="form-group">
                <label htmlFor="startDate">Start Date</label>
                <DatePicker
                  selected={formData.startDate}
                  onChange={(date) => handleDateChange(date, 'startDate')}
                  dateFormat="dd/MM/yyyy"
                  className="form-control"
                />
              </div>

              <div className="form-group">
                <label htmlFor="endDate">End Date</label>
                <DatePicker
                  selected={formData.endDate}
                  onChange={(date) => handleDateChange(date, 'endDate')}
                  dateFormat="dd/MM/yyyy"
                  className="form-control"
                />
              </div>
            </div>

            <div className="form-group">
              <label htmlFor="apartments">Buildings Count</label>
              <input
                type="number"
                className={`form-control ${errors.apartments ? 'is-invalid' : ''}`}
                id="apartments"
                name="apartments"
                placeholder="Buildings Count"
                value={formData.apartments}
                onChange={handleInputChange}
                min="1"
                required
              />
              {errors.apartments && <small className="text-danger">{errors.apartments}</small>}
            </div>

            <div className="form-group">
              <label htmlFor="buildingStatus">Building Status</label>
              <select
                id="buildingStatus"
                name="buildingStatus"
                className={`form-control ${errors.buildingStatus ? 'is-invalid' : ''}`}
                value={formData.buildingStatus}
                onChange={handleInputChange}
                required
              >
                <option value="">Select Status</option>
                <option value="Cooperation">Cooperation</option>
                <option value="House">House</option>
              </select>
              {errors.buildingStatus && <small className="text-danger">{errors.buildingStatus}</small>}
            </div>

            <button type="submit" className="btn btn-outline-primary mt-3">
              Create Project
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default CreateProject;
